- input: 'TEXT,F3XA,,"The Libertarian Party of Illinois does not pay salary or wages
    to anyone.  The Libertarian Party of Illinois has no employees and so we wouldn''t
    have any employees who spend more than 25% of their compensated time on Federal
    Election Activity or activites in connection with a Federal election.    Regarding
    itemized disbursements supporting Schedule B, a request was made to clarify the
    descrption Consulting - Administrative Work.  I amended the report and changed
    the description to read  Contractual Fees - Administrative Labor.  I also provided
    under the memo text for each line item a more detailed explanation of these expenses
    which are:  paid personnel for providing the following services:  making and receiving
    phone calls and handling correspondence; computer data entry; contracting and
    negotiating with various vendors.  This is not an employee.                                                                   Also
    reviewed request re: ''reimbursables'' in regards to an original vendor aggregating
    in excess of $200 in a calendar year.  Three items for Jeff Trigg were reimburseables:  7/18/05
    for $28.92; 9/20/05 for $53.33; and 10/20/05 for $50.72 all individual vendors
    not in excess of $200 - no action needed."'
